import styled from 'styled-components'

const StyledFooter = styled.div`
  display: flex;
  background-color: gray;
  height: 100px;
`

const Footer = () => {
  return (
    <StyledFooter>
      <span>@Guamadev</span>
    </StyledFooter>
  )
}

export default Footer
